const BookShelf = () =>{
    return (
      <div className="app">
        <div className="list-books">
          <div className="list-books-title">
            <h1>MyReads</h1>
          </div>
          <Link to="/search" className="open-search">
           Search
        </Link>
        </div>
      </div>
    );
}

export default BookShelf;
